import * as React from 'react';
import { Text, View } from 'react-native';
import { TouchableOpacity } from 'react-native-gesture-handler';

export default function CustomHeader({title, isHome, navigation}){
    return(
      <View style={{flexDirection:'row',height:50,backgroundColor:"#ddd"}}>
        {
          isHome?
          <View style={{flex:1,justifyContent:'center'}}>
              <TouchableOpacity
              onPress={() => navigation.toggleDrawer()}
              >
                <Text style={{width:30,height:30,marginLeft:5}}>E</Text>
            </TouchableOpacity>
          </View>
          :
          <View style={{flex:1,justifyContent:'center'}}>
            <TouchableOpacity
            onPress={() => navigation.goBack()}
          >
            <Text style={{width:30,height:30,marginLeft:5}}>(=</Text>
              </TouchableOpacity>
          </View>
        }

        <View style={{flex:1.5,justifyContent:'center'}}>
          <Text style={{textAlign:'center'}}>{title}</Text>
        </View>
        <View style={{flex:1}}></View>
      </View>
    )
  }
